import { useState, useEffect } from "react";
import Galeria from "../components/Galeria";
import Fotos from "../assets/json/fotos.json";

const [info, setInfo] = useState([]);

useEffect(() => {
  consultar();
}, []);

const consultar = async () => {
  //const url = 'https://gateway.marvel.com:443/v1/public/characters?&limit=10&apikey=b965a15790a46d4ec10aab442c5d9262';
  const response = await fetch(Fotos)
  const data = await response.json()
  setInfo(data.data.results);
  
}

export default function Home() {
  console.log(info)
  return (
    <div id="Home">
      <h1>Natural Pic</h1>

      <Galeria />
    </div>
  );
}
